import React, { useState, useEffect } from 'react';
import ReactFlow, { addEdge, removeElements } from 'react-flow-renderer';

const initialElements = [
  { id: 'node1', type: 'input', data: { label: 'Node 1' }, position: { x: 50, y: 50 } },
  { id: 'node2', data: { label: 'Node 2' }, position: { x: 250, y: 50 } },
  { id: 'node3', data: { label: 'Node 3' }, position: { x: 450, y: 50 } },
];

const CustomFlow = () => {
  const [elements, setElements] = useState(initialElements);

  const onConnect = (params) => {
    setElements((els) => addEdge(params, els));
  };

  const onElementsRemove = (elementsToRemove) => {
    setElements((els) => removeElements(elementsToRemove, els));
  };

  useEffect(() => {
    const source = new EventSource('your_sse_endpoint');

    source.onmessage = (event) => {
      const data = JSON.parse(event.data);
      if (data.type === 'edge') {
        setElements((els) => addEdge(data.edge, els));
      }
    };

    return () => {
      source.close();
    };
  }, []);

  return (
    <div style={{ width: '100%', height: '100%' }}>
      <ReactFlow
        elements={elements}
        onElementsRemove={onElementsRemove}
        onConnect={onConnect}
        deleteKeyCode={46} // Key code for 'delete' key
      />
    </div>
  );
};

export default CustomFlow;
